// import logo from './logo.svg';
import './App.css';

function App() {
  const pets = [
    { 
      name: 'Rolly',
      type: 'cat',
      description: 'Rolly is funny and love to be around people.',
      skills: ['fetch', 'play dead', 'roll over'],
      image: 'https://en.wiktionary.org/wiki/cat#/media/File:Cat03.jpg'

    },
    { 
      name: 'Polly',
      type: 'cat',
      description: 'Polly is funny and love to be around people.',
      skills: ['play dead', 'meaw', 'purr'],
      image: 'https://en.wiktionary.org/wiki/cat#/media/File:Cat03.jpg'

    }
  ];
  return (
    <div>
      <h1>My Pets</h1>
      <ul>
        {
          pets.map((pet, index) => {
            <li>
              <h2>{pet.name}</h2>
            </li>
          })
        }
      </ul>
    </div>
  );
}

export default App;
